	function XPRACTICE.AMIRDRASSILRAIDMAPS.FloorData.Cylinder(multisolid,sa,z,radiusx,radiusy,color,svk)
		local midx=0;local midy=0
		-- local CYL_HEIGHT=13.88788
		-- local CYL_RADIUS=13.88788
		local CYL_HEIGHT=13.889
		local CYL_RADIUS=13.88788
		local radius=math.sqrt(XPRACTICE.distsqr(midx,midy,radiusx-sa.centerx,radiusy-sa.centery))
		--print("Radius:",radius,"(",radiusx-sa.centerx,radiusy-sa.centery,")",radiusy,sa.centery)
		local scale=radius/CYL_RADIUS
		local zmodifier=CYL_HEIGHT/CYL_RADIUS

		x=0
		y=0
		local z=z-radius*2*zmodifier			
		local a=multisolid:AddActorByClass(XPRACTICE.SOLIDS["Cylinder004"..color],x,y,z,scale)
		a.x=x;a.y=y;a.targetz=z;a.scale=scale
		if(svk)then	a:SetSpellVisualKit(svk) end
		
	end	
	
